import React from "react";
import "./Dice.scss"
import dices from "../resources/0.png"
import forehand from "../resources/forehand.png"

type DiceProps = {
    header: string,
    options: string[],
    active: number
}

const Dice: React.FC<DiceProps> = ({header, options, active}) => {

    return (
        <div className="Dice">
            <h4>{header}</h4>
            <div className="Square">
                <h5>{active === 0 ? <img src={forehand} /> : options[active]}</h5>
            </div>
        </div>
    )
};

export default Dice
